def count_unvisited_leaves(N, leaves, frogs):
    leave_status = [0] / (leaves + 1)
    for frog in frogs:
        if frog <= leaves and leave_status[frog] == 0:
            for j in range(frog, leaves + 1, frog):
                leave_status[j] = 1
    unvisited_count = leaves
    for status in leave_status:
        if status == 1:
            unvisited_count -= 1
    return unvisited_count

